import React from 'react';
import './App.css';
import {Technologies} from "./Technologies";
import {Header} from "./Header";
import {Footer} from "./Footer";

function App() {
    return (
        <div className="app-wrapper">
            Hello, samurai! Let's go!
            <header className={'header'}>
                <img className={'header-img'} src='https://upload.wikimedia.org/wikipedia/commons/thumb/2/24/LEGO_logo.svg/512px-LEGO_logo.svg.png' alt={'logo'}/>
                <Header/>
            </header>
            <nav className={'nav'}>
                <div className={'content'}>
                    <div>content</div>
                    <Technologies/>
                </div>
            </nav>


            <Footer/>

        </div>
    );
}


export default App;
